import React, { Fragment } from "react";
import { Route, Switch } from "react-router-dom";
import CheckOut from "./MainPage/CheckOut";
import MainSection from "./MainPage/MainSection";
import Page from "./MainPage/Page";
import ProductDetail from "./MainPage/ProductDetail";
import Order from "./MainPage/Order";
import Footer from "./MainPage/Footer";

const App = () => {
  return (
    <div style="position= reltive">
      <Page />
      <Switch>
        <Route path="/home" exact>
          <MainSection />
        </Route>
        <Route path="/product_detail">
          <ProductDetail />
        </Route>
        <Route path="/checkout">
          <CheckOut />
        </Route>
        <Route path="/order">
          <Order />
        </Route>
      </Switch>
      <Footer />
    </div>
  );
};

export default App;
